import { useEffect , useState} from 'react'

const Home = () => {
  useEffect(() => {
    const fetchWorkouts = async () => {
      const response = await fetch('http://localhost:4000/api/workouts')
      const json = await response.json()

    }

    fetchWorkouts()
  },[])
  return (
    <div className='home'>
        <h1>Home</h1>
    </div>
  )
}

export default Home
